import React, { Component } from "react";
import { Form, Container, Button } from "react-bootstrap";
import axios from "axios";

export default class Register extends Component {
  state = {};

  registerHandler = async () => {};

  changeHandler = (e) => {
    // console.log("name of field", e.target["name"]);
    // console.log("value of field", e.target.value);
    let temp = { ...this.state }; //copy state object
    temp[e.target.name] = e.target.value;
    this.setState(temp);
  };

  render() {
    console.log(this.state);
    return (
      <div>
        <Container>
          <Form.Group>
            <Form.Label>First Name</Form.Label>
            <Form.Control name="first_name" onChange={this.changeHandler} />
          </Form.Group>
          <Form.Group>
            <Form.Label>Last Name</Form.Label>
            <Form.Control name="last_name" onChange={this.changeHandler} />
          </Form.Group>
          <Form.Group>
            <Form.Label>Email</Form.Label>
            <Form.Control name="email" onChange={this.changeHandler} />
          </Form.Group>
          <Form.Group>
            <Form.Label>Password</Form.Label>
            <Form.Control
              name="password"
              type="password"
              onChange={this.changeHandler}
            />
          </Form.Group>
          <Button variant="primary" onClick={this.registerHandler} block>
            Register
          </Button>
        </Container>
      </div>
    );
  }
}
